Hur, okay. I'm now fairly certain that the exception is a red herring. ~~I believe the actual issue is that jdtls appears to have adopted its own message format for progress reporting.~~

EDIT: Scratch that. Rather than doing its own thing, I think jdtls is now complying to the LSP standard protocol. This temp fix is probably no longer necessary: #2153

In the meantime, a better workaround is to edit your jdtls.lua file (mine is at `~/.local/share/nvim/plugged/nvim-lspconfig/lua/lspconfig/server_configurations/jdtls.lua`) and comment out line

```
['$/progress'] = vim.schedule_wrap(on_language_status)
```

 I tried printing out the full results of the `$/progress` command like so

```lua
local function on_language_status(_, result)
  print("[on_language_status_test]", vim.inspect(result))
end
lspconfig.jdtls.setup({
    handlers = {
        ["$/progress"] = vim.schedule_wrap(on_language_status),
    },
})
```

and I get output like so

```
[on_language_status_test] {
  token = "da4cc7ab-b5dd-4ee0-85ea-f5627ebb5abd",
  value = {
    kind = "report",
    message = "Initialize Workspace",
    percentage = 32
  }
}
[on_language_status_test] {
  token = "da4cc7ab-b5dd-4ee0-85ea-f5627ebb5abd",
  value = {
    kind = "end",
    message = "Initialize Workspace"
  }
}
[on_language_status_test] {
  token = "e8d17a73-ef45-48ae-a1ea-d6e394636af6",
  value = {
    kind = "begin",
    message = "Synchronizing projects",
    title = "Synchronizing projects"
  }
}
[on_language_status_test] {
  token = "e8d17a73-ef45-48ae-a1ea-d6e394636af6",
  value = {
    kind = "report",
    message = "Synchronizing projects",
    percentage = 0
  }
}
[on_language_status_test] {
  token = "5c767aa7-b035-4b79-bf26-f3a0ac08cced",
  value = {
    kind = "begin",
    message = "Synchronizing projects",
    title = "Synchronizing projects"
  }
}
```

@hraytilakhealthcare As a workaround, I believe you can just suppress nil messages.

```lua
local function on_language_status(_, result)
  -- Ignore nil messages.
  if result.message == nil then
      return
  end
  local command = vim.api.nvim_command
  command 'echohl ModeMsg'
  command(string.format('echo "%s"', result.message))
  command 'echohl None'
end
lspconfig.jdtls.setup({
    handlers = {
        ["$/progress"] = vim.schedule_wrap(on_language_status),
    },
})
```
